&quot;CARBON_INTENSITY_INFO&quot;:&quot;
 (Tons CO2E/$M SALES)&lt;br&gt;
 The MSCI Weighted Average Carbon Intensity measures a fund&apos;s exposure to carbon intensive companies. This figure represents the estimated greenhouse gas emissions per $1 million in sales across the fund’s holdings. The figure is a sum of the normalized security weight multiplied by the security Carbon Intensity. This allows for comparisons between funds of different sizes.

